import Menu from "./Menu";
import Footer from "./Footer";

export class Layout extends React.Component {
    render() {
        const {children} = this.props
        return (
            <>
                <Header/>
                <Menu/>
                {children}
                <Footer/>
            </>
        );
    }
}
